(626, 'Alimento dietético completo para la ayuda al metabolismo de las articulaciones en el caso de la artrosis en perros adultos   : Pollo fresco 30%. Proteína deshidratada de pollo. Arroz. Hidrolizado de hígado de pollo. Pulpa de remolacha. Levaduras. Semillas de linaza. Aceite de pollo. Aceite de pescado. Sustancias minerales. Glucosamina. Metilsulfonilmetano (MSM). Inulina (fuente de FOS). Condroitina. Pared celular hidrolizada de levaduras (fuente de MOS). Yucca schidigera.   : Proteína bruta 27%. Grasa bruta 14,25%. Ácidos grasos omega-3 3%. EPA 0,35%. Fibra bruta 2,75%. Ceniza bruta 8%. Calcio 1,40%. Fósforo 1,10%. Energía metabolizable 3750 kcal/kg.   : Aditivos nutricionales: Vitamina A 18000 UI/kg. Vitamina D3 1800 UI/kg. Vitamina E 600 mg/kg. Vitamina C 200 mg/kg. Hierro (sulfato de hierro (II), monohidratado) 68 mg/kg. Yodo (yoduro potásico) 3,20 mg/kg. Cobre (sulfato de cobre (II) pentahidratado) 9 mg/kg. Manganeso (sulfato manganoso monohidratado) 6,80 mg/kg. Zinc (óxido de zinc) 108 mg/kg. Selenio (selenito de sodio) 0,11 mg/kg. Taurina 770 mg/kg. L-carnitina 270 mg/kg. Aditivos tecnológicos: Antioxidantes: Extractos de tocoferol de aceites vegetales    El cambio de alimento debe hacerse de forma gradual durante 7 días. Suministre la ración diaria, preferiblemente, dividida en 2 o 3 tomas al día y siempre a las mismas horas. La cantidad de alimento puede variar en función de la actividad, raza del perro y condiciones medioambientales. Se recomienda consultar a un veterinario antes de utilizarlo o de prolongar su período de utilización. Periodo recomendado de utilización, inicialmente, 3 meses. Los perros deben disponer siempre de agua limpia y fresca. Fabricado en la UE. Nº de lote, utilizar preferentemente antes del, nº de aut \n \n \n \n \n \n \n \n '),
