(1092, 'Alimento completo dietético para el mantenimiento de la función dérmica en caso de dermatosis y pérdida excesiva de pelo en perros adultos   : Salmón fresco 30%. Proteína deshidratada de salmón. Patata. Arroz. Aceite de pollo. Hidrolizado de salmón. Levaduras. Pulpa de remolacha. Aceite de pescado. Sustancias minerales. Inulina (fuente de FOS). Pared celular hidrolizada de levaduras (fuente de MOS). Extractos de cítricos. Yucca schidigera. Extracto de marigold (fuente de luteína). Jengibre.     : Proteína bruta 28,25%. Grasa bruta 18%. Ácidos grasos omega-3 1,10%. Ácidos grasos omega-6 2,95%. EPA+DHA 0,50%. Fibra bruta 2,50%. Ceniza bruta 7%. Calcio 1,15%. Fósforo 0,80%. Energía metabolizable 4000 kcal/kg.   : Aditivos nutricionales: Vitamina A 20000 UI/kg. Vitamina D3 2000 UI/kg. Vitamina E 600 mg/kg. Hierro (sulfato de hierro (II), monohidratado) 75 mg/kg. Yodo (yoduro potásico) 3,50 mg/kg. Cobre (sulfato de cobre (II) pentahidratado) 10 mg/kg. Manganeso (sulfato manganoso monohidratado) 7,50 mg/kg. Zinc (óxido de zinc) 120 mg/kg. Selenio (selenito de sodio) 0,12 mg/kg. Taurina 750 mg/kg. L-carnitina 70 mg/kg. Aditivos tecnológicos: Antioxidantes: Extractos de tocoferol de aceites vegetales    El cambio de alimento debe hacerse de forma gradual durante 7 días. Suministrar la ración diaria, preferiblemente, dividida en 2 ó 3 tomas al día, y siempre a las mismas horas. La cantidad de alimento puede variar en función de la actividad, raza del perro y condiciones medioambientales. Se recomienda consultar a un veterinario antes de utilizarlo. Periodo recomendado de utilización, inicialmente, 2 meses. Los perros deben disponer siempre de agua limpia y fresca. Fabricado en la UE. Nº de lote, utilizar preferentemente antes del, nº de autorización del fabricante y peso neto figuran impresos en el envase. Conservar en lugar fresco y seco. \n \n \n \n \n \n \n \n '),
