(1711, '60 % cordero recién preparado, patatas (3 %), calabaza (2 %), manzanas (2 %), zanahorias (1 %), guisantes (1 %), brécol (1 %), arándanos azules (1 %), semillas de lino, minerales. Extractos botánicos y hierbas aromáticas: vara de oro, ortiga, semillas de anís, escaramujo, pétalos de caléndula, amor de hortelano, kelp, alfalfa, semilla de cardo, raíz de diente de león, raíz de bardana, semillas de apio.\nAditivos (por kg)\nVitaminas: vitamina D3 200 UI, vitamina E 20 mg. Oligoelementos: cinc (como quelato de cinc de hidrato de glicina) 15 mg, manganeso (como quelato de manganeso de hidrato de glicina) 1,4 mg, yodo (como yodato de calcio anhidro) 0,75 mg. Aditivos tecnológicos: harina de semillas de algarrobo. '),
