(1713, 'Este es un alimento completo desde el punto de vista nutricional para perros adultos de más de 4 meses, con pato, pato salmón y ciervo. : 35 % ingredientes recién preparados: pato (20 %), salmón (10 %), ciervo (5 %). Patatas, proteína de guisantes, lentejas enteras, guisantes enteros, huevos, linaza, minerales, salsa de cordero, levadura nutricional, extractos botánicos y hierbas aromáticas* (1 %), prebióticos (manano-oligosacáridos 1,8 g/kg, fructo-oligosacáridos 1,1 g/kg), zanahorias, manzanas, mezcla para el cuidado de las articulaciones (metilsulfonilmetano 200 mg/kg, glucosamina 170 mg/kg, sulfato de condroitina 125 mg/kg), arándanos rojos, zarzamoras, espinacas. *Extractos botánicos y hierbas aromáticas: alfalfa, pamplina, amor de hortelano, vara de oro, ortiga, algas, raíz de diente de león, semillas de apio, semilla de cardo, raíz de bardana, flor de caléndula, escaramujo. '),
