(1715, 'Este es un alimento completo desde el punto de vista nutricional para cachorros de hasta 12 meses, con pollo, salmón y guisantes. : 44 % pollo y salmón: pollo fresco (27 %), salmón recién preparado (10 %), hígado de pollo (7 %). Boniato, proteína de guisantes, proteína de patata, lentejas enteras, guisantes enteros (4 %), grasa de pollo, huevos, salsa de pollo, linaza, minerales, extractos botánicos y hierbas aromáticas* (1 %), aceite de salmón, mezcla para el cuidado de las articulaciones (metilsulfonilmetano 1.600 mg/kg, glucosamina 1 500 mg/kg, sulfato de condroitina 1.500 mg/kg), prebióticos (manano-oligosacáridos 2,5 g/kg, fructo-oligosacáridos 1,5 g/kg), zanahorias, manzanas, arándanos rojos, espinacas. *Extractos botánicos y hierbas aromáticas: alfalfa, pamplina, amor de hortelano, vara de oro, ortiga, algas, raíz de diente de león, semillas de apio, semilla de cardo, raíz de bardana, flor de caléndula, escaramujo. ');
